query postQuery(
  $slug: String!
) {
  contentfulPost(slug: {eq: $slug}) {
    title
    slug
    tagline {
      childMarkdownRemark {
        rawMarkdownBody
      }
    }
    body {
      childMarkdownRemark {
        html
      }
    }
    thumbnail {
      fluid(maxWidth: 800) {
        ...GatsbyContentfulFluid
      }
    }
    hero {
      fluid(maxWidth: 800) {
        ...GatsbyContentfulFluid
      }
    }
    timeline {
      childMarkdownRemark {
        rawMarkdownBody
      }
    }
  }
}

fragment GatsbyContentfulFluid on ContentfulFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

